import React, { useEffect } from 'react';
import { drawMap } from './drawMap';
import './treemap';
import './radial';
import './partition';
import './circlePacking';
import './index.css';

function App() {
  useEffect(() => {
    drawMap();
  }, []);

  return (
    <div className="App">
      <h1>Mapa de Estados de USA</h1>
      <div id="map"><svg width="800" height="500"></svg></div>
      <h2>Treemap</h2>
      <div id="treemap"><svg width="1000" height="500"></svg></div>
      <h2>Radial</h2>
      <div id="radial"><svg width="1000" height="500"></svg></div>
      <h2>Partition</h2>
      <div id="partition"><svg width="1000" height="500"></svg></div>
      <h2>Circle Packing</h2>
      <div id="circlePacking"><svg width="1000" height="500"></svg></div>
    </div>
  );
}

export default App;
